import React from 'react';
import Card from './Post Animation'


class Post extends React.Component {
    constructor(){
        super()
        this.state = {
            verified : false,
            key : this.props.key
        }
    }



    render(){
        console.log(this.state.key)

        return(
            <Card title={this.props.title} key={this.props.key}></Card>
        )
    }
}


export default Post
